  return (
    <>
    <BrowserRouter>
      <Nav/>
      <Routes>
       <Route path="/"      element={<Home  />} />
       <Route path="/Men"   element={<Men   />} />
       <Route path="/Women" element={<Women />} />
      </Routes>
       <Footer/>
    </BrowserRouter>
    </>
  );
}

